import './App.css';
import React from 'react';
import 'font-awesome/css/font-awesome.min.css';

import Table  from './components/table';
import PersonalDetails  from './components/personalDetails';
import Skills from './components/skills';

class App extends React.Component {

  constructor(props) {
    // initializing
    super(props);
    this.experience = require("./details/resume.json");
  }

  componentDidMount() {
    // Setting title of page
    document.title = "Resume";
    document.body.style.backgroundColor = "lightbrown";
  }

  render() {
    return (
      <>
      <PersonalDetails />          

        <div  className="container">
          <div className="main">
            <Skills />
            <Table
              details={this.experience.Experience}  
              header={["Company","Designation", "StartDate", "EndDate"]} 
              title="Experience" />
            <Table
              details={this.experience.Internship}
              header={["Company","Designation", "StartDate", "EndDate"]} 
              title="Internship" />
            <Table details={this.experience.Education}
              header={["Institute","Level", "EndDate", "Percentage"]}
              title="Education" />
          </div>

      </div>
    </>);
  }
}

export default App;
